import React from 'react';
import './App.css';
import Projects from "./Projects"
import About from "./About"
import Navbar from "./Navbar"
import Contact from "./Contact"
import Footer from "./Footer"
import Particles from 'react-particles-js';

function App() {
  return (
    <div className="App">
      <Navbar />
      <Particles
    params={{
	    "particles": {
	        "number": {
	            "value": 50
	        },
	        "size": {
	            "value": 3
	        }
	    },
	    "interactivity": {
	        "events": {
	            "onhover": {
	                "enable": true,
	                "mode": "repulse"
	            }
	        }
	    }
	}} />
      <About />
      <Projects />
      <Contact />
      <Footer />
    </div>
  );
}

export default App;
